import React from 'react';
import maleAvatar from '../../img/male_avatar.svg';

const Work = () => {
  return (
    <div className='grid-2'>
      <div>
        <h1>What we do to help our client shop more faster.</h1>
      </div>
      <div className='card'>
        <div>
          <img src={maleAvatar} alt='Our Work' />
        </div>
      </div>
    </div>
  );
};

export default Work;
